import React from "react";

const url =
  "data:image/jpeg;base64,";

type FancyImagePropsType = {
  url: string;
};
const FancyImage = (props: FancyImagePropsType) => {
  return (
    <img
      src={props.url}
      style={{
        border: "6px solid red",
        padding: 10,
        borderRadius: 15,
        backgroundColor: "yellow",
      }}
    />
  );
};

type MaksimProfilePicturePropsType = {
  name: string;
  profileImageUrl: string;
};
const MaksimProfilePicture = (props: MaksimProfilePicturePropsType) => {
  return (
    <div>
      <FancyImage url={props.profileImageUrl} />
      <span>{props.name}</span>
    </div>
  );
};

export const App = () => {
  return (
    <div>
      <h1>Hello world</h1>
      <MaksimProfilePicture name="Maksim Romanenko" profileImageUrl={url} />
      <MaksimProfilePicture
        name="Lena"
        profileImageUrl="data:image/jpeg;base64,"
      />
      <MaksimProfilePicture
        name="Matvey"
        profileImageUrl="data:image/jpeg;base64,"
      />
      <h1> Hello fancy image</h1>
      <FancyImage url="data:image/jpeg;base64," />
      {/* <MaksimProfilePicture />
      <MaksimProfilePicture /> */}
    </div>
  );
};
